A x B, also known as the Cartesian product of A and B, is the set of all ordered pairs (a, b) where a is in A and b is in B. 

A x B = {(1, 3), (1, 4), (2, 3), (2, 4)}

B x A is the set of all ordered pairs (b, a) where b is in B and a is in A.

B x A = {(3, 1), (3, 2), (4, 1), (4, 2)}

Now, let's compare A x B and B x A:

A x B = {(1, 3), (1, 4), (2, 3), (2, 4)}
B x A = {(3, 1), (3, 2), (4, 1), (4, 2)}

As we can see, the ordered pairs in A x B are not the same as the ordered pairs in B x A. For example, (1, 3) is in A x B but not in B x A, and (3, 1) is in B x A but not in A x B. Therefore, A x B is not equal to B x A.
